import Image from 'next/Image';
import Head from 'next/head';

export default function Post() {
  return (<>
    <Head>
      <title>Projects | Aceso</title>
    </Head>

    <Image src="/images/projects/Aceso/Landing.jpg" layout="fill" />

    <div className="py-20 h-screen mx-auto">
      <p className="text-white text-center">Testing</p>
    </div>

  </>)
}
